import React from "react";
import data from "../data.js";


function createRow(input){
  return (
    <tr>       
    <td>{input.ak}</td>
    <td>{input.fname}</td>
    <td>{input.lname}</td>      
   </tr>
  )
}




function TableData(){
    return (
        <tr>       
        <td>345654756745</td>
        <td>Tomas</td>
        <td>Blazys</td>      
      </tr>
    )
}


export default TableData;
